INSERT INTO `gygy_content` (`id`, `nodeId`, `enable`, `addTime`, `title`, `content`) VALUES
(40, 1, 1, 1409465865, '安全通告', '安全通告，谨防受骗 近期发行有仿冒我们平台的，千万注意安全，平台在外从未设置QQ客服。\n                                              -----诚信铸造品牌，安全值得信赖\n'),
(41, 1, 1, 1409465922, '关于自动充值', '：平台为集团公司账户充值支持全国29家主流银行，信用卡，财付通和支付宝充值。充值请看清平台账号，平台支付宝和财付通收款账号，为不固定的随时更换。\r\n                                             -----诚信铸造品牌，安全值得信赖\r\n                                                                 金财神娱乐城'),
(42, 1, 1, 1409465955, '关于充值提款', '：平台为全自动充值提款，24小时自动到账；如有未到账情况，请及时点击右上角在线客服，联系客服解决。提款时间为上午10点至晚上24点，正常3分钟内即时到账，遇忙不超过30分钟。\n                                              -----诚信铸造品牌，安全值得信赖\n'),
(43, 1, 1, 1409466096, '银行卡绑定', '亲 个位会员您好，为了提款能迅速到账，请亲们绑定银行卡的时候一定要选择好是那个银行《如中国银行，工商银行》如无法分辨的银行卡账号只能拒绝后联系客服重新修改。'),
(44, 1, 1, 1409466161, '关于自动充值到账', '选择支付宝和财付通充值的请会员们一定要看好平台收款账号在充值，平台收款账户是不定期更换的。支付宝财付通充值的时候请各位亲们 只在说明上填那几个数字编号《比如  01234， 4567》 不要写其他的字，很多人在说明填转账二字，或者编号XXX都是错的，只写那几位数字就可以了。 如5分钟内还没到账，请及时联系平台在线客服。'),
(46, 0, 1, 1459138998, '关于网站QQ客服重要说明', '各位会员请注意，注意，注意！重要的事情说三遍，最近发现有人利用QQ软件冒充网站客\r\n\r\n服，为了各位用户的安全，请大家注意，我们网站是没有QQ客服的，如发现有人以金财神\r\n\r\n名义加你好友肯定是骗子，大家一定要谨慎\r\n\r\n如有任何问题请及时联系网站右上角在线客服，'),
(47, 0, 1, 1460549563, '超级赠送活动', '1，注册新会员首次充值赠送18元《满百即可提款》\r\n2，每个会员当天首次充值满1000赠送50元，2000送100元以此类推《消费两倍即可》\r\n3，下级日投注量10万奖励168元，消费20万送368元，30万奖励668元以此类推。\r\n4，代理双佣金，玩家积分兑换绑定工行的奖励不变。\r\n5,冲多少送多少，消费本金的40倍流水即可提款。《参与者自觉根据规定投注超过65%为违规，第一次警告第二次封号，撤单的另外增加对应的3倍投注量》\r\n注：参与活动的请自觉遵守游戏规则，充值成功后请及时联系客服，不联系客服视为放弃，恶意刷资金，多账号的，用小号取款的一律封号处理。'),
(48, 0, 1, 1459138984, '代理奖励扶持', '代理双佣金\r\n会员充值1000  上级8 上上级6\r\n会员消费1000  上级5 上上级3\r\n\r\n永久日工资\r\n销量要求	当日奖励	奖励周期\r\n日量2W+         66元	          每天\r\n日量5W+   	188元          	每天\r\n日量10W+	388元	          每天\r\n日量20W+	888元    	每天\r\n日量30W+	1288元   	每天\r\n日量50W+	2500元  	每天\r\n日量100W+       5000元   	每天\r\n日量150W+	7500元  	每天\r\n日量200W+	10000元   	每天\r\n日量300W+	15000元  	每天\r\n日量400W+	20000元	      每天\r\n日量500W+	25000元	      每天\r\n按100W为单位以此类推	上不封顶\r\n说明: 每天日量过2万，团队当天无论盈亏，每天有此工资。  ');
